import './App.css';
import Navigation from '../Navigation/Navigation';
import PostsList from '../PostsList/PostsList';
import TodoList from '../TodoList/TodoList';

function App() {
  return (
    <div>
      <Navigation />
      <PostsList />
      <TodoList />
    </div>
  );
}

export default App;
